export default function Addgame() {

    const[name, setname]= useState('')
    const [pcprice, setpcprice]= useState()
    const [ps4price, setps4price]= useState()
    const [ps5price, setps5price]= useState()
    const [image , setimage] = useState('')
    const [description, setdescription] = useState('')
    const [category, setcategory]= useState('') 
  return (
    <div>
      
      <div>
          <h1>Add Game</h1>

          <form>
              <input type="text" placeholder="name" value={name} onChange={(e)=>{setname(e.target.value)}}/>
              <input type="text" placeholder="pc platform price" value={pcprice} onChange={(e)=>{setpcprice(e.target.value)}}/>
              <input type="text" placeholder="ps4 platform price" value={ps4price} onChange={(e)=>{setps4price(e.target.value)}}/>
              <input type="text" placeholder="ps5 platform price" value={ps5price} onChange={(e)=>{setps5price(e.target.value)}}/>
          </form>
      </div>
    </div>
  )
}
